import React from 'react';
import './AITestingTools.css';  // 更新了导入路径


const aiTestingTools = [
  { name: 'KushoAI', description: '使用AI在几分钟内测试后端流程。', link: '/ai-testing-tools/kushoai' },
  { name: 'Claude Computer Use', description: 'Anthropic公司开发的AI工具，用于自动化操作。', link: '/ai-testing-tools/claude-computer-use' },
  { name: 'TableSprint', description: '一个AI平台，用于构建面向未来的应用程序。', link: '/ai-testing-tools/tablesprint' },
  { name: 'FocusBuddy', description: '一个始终在线的AI执行助手。', link: '/ai-testing-tools/focusbuddy' },
  { name: 'AssemblyAI', description: '一个多语言语音转文本API，具有超人的准确性。', link: '/ai-testing-tools/assemblyai' },
];

function AITestingTools() {
  return (
    <div className="ai-testing-tools">
      <h1>AI 测试工具合集</h1>
      <ul>
        {aiTestingTools.map((tool, index) => (
          <li key={index}>
            <a href={tool.link}>{tool.name}</a> - {tool.description}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default AITestingTools;
